import { Component } from "react";
import React from "react";
import Table from 'react-bootstrap/Table';
import 'bootstrap/dist/css/bootstrap.min.css'
import DataTable from "react-data-table-component";

class PatientsTable extends Component {

    constructor(props) {
        super(props);
        this.state = {
            patientData: []
        };
    }

    componentDidMount() {
        fetch('/api/v1/patients', {
            method: 'GET',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
            },
        })
            .then(res => res.json())
            .then(
                (result) => {
                    let jsObj = result;

                    for (let step = 0; step < jsObj.length(); step++){
                        console.log(jsObj[step])
                    }

                    this.state.patientData = jsObj;
                    console.log(jsObj)
                },
                (error) => {
                    console.log(error)
                }
            )
    }

    render() {
        return (
            <div>
                <DataTable title="Arnold Movies" columns={columns} data={this.state.patientData}></DataTable>
            </div>
        )
    }

}
const data = [{ id: 1, title: 'Conan the Barbarian', year: '1982' }];
const columns = [
    {
        name: 'Name',
        selector: 'name',
        sortable: true,
    },
    {
        name: 'Year',
        selector: 'year',
        sortable: true,
        right: true,
    },
];


export default PatientsTable;
